import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';

const TodayaActivities = () => {
  return (
    <div className="progressbar-main__container">
    <div className="progress-bar-container">
      <div className="outer-path">
        <CircularProgressbar
          value={70}
          text={`${70}%`}
          strokeWidth={10}
          styles={buildStyles({
            strokeLinecap: 'butt',
            pathColor: `rgba(62, 152, 199, 0.8)`,
            trailColor: '#d6d6d6',
          })}
        />
      </div>
      <div className="inner-path">
        <CircularProgressbar
          value={70}
        //   text={`${70}%`}
          strokeWidth={8}
          styles={buildStyles({
            strokeLinecap: 'butt',
            pathColor: `rgba(62, 152, 199, 0.5)`,
            trailColor: 'transparent',
          })}
        />
      </div>
    </div>
    </div>
  );
};

export default TodayaActivities;
